import pg from 'pg';

let connectionString = "postgres://blaise:ballack13@my_local_server/ip:5432/fifa";
let pgClient = new pg.Client(connectionString);
pgClient.connect();
let query = pgClient.query("SELECT * FROM legends");

query.on("row", function(row, result){
    result.addRow(row);
});

console.log(result);

export default Data;
